$GLOBALS['emoji_maps']['html_to_unified'] = array_flip($GLOBALS['emoji_maps']['unified_to_html']);

class Emoji
{
    #
    # functions to convert incoming data into the unified format
    #

    public static function emoji_docomo_to_unified($text)
    {
        return self::emoji_convert($text, 'docomo_to_unified');
    }

    public static function emoji_kddi_to_unified($text)
    {
        return self::emoji_convert($text, 'kddi_to_unified');
    }

    public static function emoji_softbank_to_unified($text)
    {
        return self::emoji_convert($text, 'softbank_to_unified');
    }

    public static function emoji_google_to_unified($text)
    {
        return self::emoji_convert($text, 'google_to_unified');
    }


    #
    # functions to convert unified data into an outgoing format
    #

    public static function emoji_unified_to_docomo($text)
    {
        return self::emoji_convert($text, 'unified_to_docomo');
    }

    public static function emoji_unified_to_kddi($text)
    {
        return self::emoji_convert($text, 'unified_to_kddi');
    }

    public static function emoji_unified_to_softbank($text)
    {
        return self::emoji_convert($text, 'unified_to_softbank');
    }

    public static function emoji_unified_to_google($text)
    {
        return self::emoji_convert($text, 'unified_to_google');
    }


    #
    # HTML transformation
    #

    public static function emoji_unified_to_html($text)
    {
       // $pregList = '('.implode('|',array_keys($GLOBALS['emoji_maps']['unified_to_html'])).')';


//$preg=self::$unified_rx;
      //  return preg_replace_callback("!$pregList(\\xEF\\xB8\\x8E|\\xEF\\xB8\\x8F)?!", function ($m) {
        return preg_replace_callback($GLOBALS['emoji_maps']['unified_rx'], function ($m) {

            if (isset($m[2]) && $m[2] == "\xEF\xB8\x8E") return $m[0];
            $cp = $GLOBALS['emoji_maps']['unified_to_html'][$m[1]];
            return "<span class=\"emoji emoji{$cp}\"></span>";
        }, $text);
    }

    public static function emoji_html_to_unified($text)
    {
        return preg_replace_callback("!<span class=\"emoji emoji([0-9a-f]+)\"></span>!", function ($m) {
            if (isset($GLOBALS['emoji_maps']['html_to_unified'][$m[1]])) {
                return $GLOBALS['emoji_maps']['html_to_unified'][$m[1]];
            }
            return $m[0];
        }, $text);
    }


    public static function emoji_convert($text, $map)
    {

        return str_replace(array_keys($GLOBALS['emoji_maps'][$map]), $GLOBALS['emoji_maps'][$map], $text);
    }

}